import Test.Hspec
import Reduction

main = hspec $ do
    describe "reduce" $ do
        it "should reduce units with opposite polarity" $ do
            reduce "ab" `shouldBe` "ab"
            reduce "Aa" `shouldBe` ""
            reduce "BB" `shouldBe` "BB"
            reduce "bB" `shouldBe` ""
            reduce "Aab" `shouldBe` "b"
        it "should reduce several pairs of units" $ do
            reduce "CcDd" `shouldBe` ""
        it "should chain reductions after reductions" $ do
            reduce "abBA" `shouldBe` ""
            reduce "AaA" `shouldBe` "A"
            reduce "Aaa" `shouldBe` "a"
            reduce "dabAcCaCBAcCcaDA" `shouldBe` "dabCBAcaDA"
            length (reduce large)  `shouldBe` 10584

large = ""
